        const res = <qs className="parse"></qs>(this.props.location.search);
        console.log(res);
        return (
            <React.Fragment>
                <h1>Details No {this.props.match.params.id}</h1>
                <h2>{pro.name}</h2>
                <h2>Count in Shopping Card: {pro.count}</h2>
            </React.Fragment>
        );
    }
}

export default ProductDetails;
